import React, { Component } from "react";

class MovieContainer extends Component {
  render() {
    const movie = this.props.movie;
    return (
      <div key={movie.id} className="movie-item">
        <img src={movie.Poster} />
        <h3>{movie.title}</h3>
      </div>
    );
  }
}

export default MovieContainer;
